def getNoZeroIntegers(self, n):
    a = 1
    while '0' in f'{a}{n-a}':
        a += 1
    return [a, n-a]

def getNoZeroIntegers(self, n):
    for a in range(n):
        if '0' not in f'{a}{n-a}':
            return [a, n-a]

class Solution:
    def getNoZeroIntegers(self, n: int):
        low = 0
        high = n

        while low<=high:
            while str(low).count('0') != 0:
                low += 1

